// SPDX-License-Identifier:MIT
pragma solidity ^0.8;

contract testABI1{
    // 获得编码以后的数据  按照ABI的编码规则
    bytes public c = abi.encode(5,1);

    uint public d;
    int public e;

    constructor(){
        (d,e) = abi.decode(c,(uint,int));
    }
}

contract testABI2{
    // 获得编码以后的数据  按照ABI的编码规则
    bytes public c = abi.encodePacked("5");

    uint public d;
    int public e;

    constructor(){
        (d,e) = abi.decode(c,(uint,int));
    }
}

